import '../../App.css';
import logo from '../../images/logo.png';
import home from '../../images/home.png';
import favourite from '../../images/favourite.png';
import profile from '../../images/profile.png';
import React from 'react';
import {NavLink}
	from "./NavBarElements";

function TopNav() {
  return (
  <div  className="top_nav" style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center' }}>
    <img src={logo} alt="MarketPlants" />
    <div style={{ display: 'flex', alignItems: 'center' }}>
      <NavLink to="/sign-up" activeStyle>
        <img src={home} alt="Buy" style={{ marginRight: '10px' }} />
      </NavLink>
      <NavLink to="/sign-up" activeStyle>
        <img src={favourite} alt="Favourites" style={{ marginRight: '10px' }} />
      </NavLink>
      <NavLink to="/sign-up" activeStyle>
        <img src={profile} alt="Profile" style={{ marginRight: '10px' }} />
      </NavLink>
    </div>
  </div>

  );
}
export default TopNav;
